const ShowFiltered = ({ filtered }) => {
    console.log("from show filtered", filtered);
    return (
        <div>
          {
            filtered.length===0
            ? filtered.map(p => 
              <div key = {p["name"]["common"]}>
                {p["name"]["common"]}
              </div>
              )

            : "n"

          }

        </div>
    )
}
export default ShowFiltered
